import Dashboard from "./dashboard";
import Garage from "./carsList";
import LoginForm from "./loginForm";
import RegisterForm from "./registerForm";
import { BrowserRouter, Routes, Route, Link, Outlet } from 'react-router-dom'
import './App.css'
import NavBar from "./navBar";

function App() {
  let username = "jeeva"
  let password = 'jeeva123'
  let pages = ['home', 'login', 'register', 'dashboard']
  // let isLogin = false
  // let isRegister = true
  // if (isLogin) {
  //   return <LoginForm />
  // } else {
  //   if (isRegister) {
  //     return <RegisterForm />
  //   } else {
  //     return (<div>
  //       <Dashboard username={username} password={password} />
  //       <Garage />
  //     </div>)
  //   }
  // }

  return (
    <div>
      <NavBar />
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<Garage />} />
          <Route path="register" element={<RegisterForm />} />
          <Route path="login" element={<LoginForm />} />
          <Route path="dashboard" element={<Dashboard />} />
        </Routes>
      </BrowserRouter>
    </div>
  )

}

export default App;
